import $ from 'jquery';

$(document).ready(function() {
  const wordyContent = "Some random word";
  
  wordyContent.split(' ').forEach(w => {
    const span = document.createElement("span");
    span.innerText = `${w} `
    span.addEventListener('mouseover', function(){
      console.log(this.innerText.trim())
    })

    $('.wordy').append(span)
  })
});

