import React from "react";
import ReactDOM from "react-dom";
import "./../styles.css";

let objectBlob = [
  {
    name: 'Bob',
    age: 22
  },
  {
    name: 'Ive',
    age: 25
  },
  {
    name: 'George',
    age: 32
  }
]

function App() {
  return (
    <div className="App">
      {objectBlob.map(b => {
        return(
          <div>{b.name}</div>
        )
      })}
    </div>
  );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);

import React, {useState} from "react";
import ReactDOM from "react-dom";
import "./../styles.css";

const Item = () => (
  <div>
    <h1>Hello</h1>
  </div>
)

// Function component with useState hook
// Read about state: https://reactjs.org/docs/state-and-lifecycle.html
// Read more about React Hooks https://reactjs.org/docs/hooks-intro.html
function App() {
  const [items, setItems] = useState([1])
  const handleClick = () => setItems([...items, 1]) 
  return (
    <div className="App">
      {items.map((item,i) => <Item key={i}/>)}
      <button onClick={handleClick}>Add one more item</button>
    </div>
  );
}

// Class components
class ClassApp extends React.Component{
  state = {
    items: []
  }

  handleClick = () => this.setState(prevState => ({items: [...prevState.items, 1]}))

  render(){
    return(
<div>
      {this.state.items.map((item,i) => <Item key={i}/>)}
      <button onClick={this.handleClick}>Add one more item</button>
    </div>
    )
  }
}

const rootElement = document.getElementById("root");
// ReactDOM.render(<App />, rootElement);
ReactDOM.render(<ClassApp />, rootElement);

